import React from "react";
import "./Rules.css";

function Gallery() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <div className="rules-container text-break" style={{ display: "flex", gap: "20px", flexWrap: "wrap" }}>
        
        {/* Vänster kolumn – text om klubben */}
        <div style={{ flex: 1, minWidth: "300px" }}>
          <p>
            Här kan du se bilder från våra sjöar, evenemang och aktiviteter. Följ oss gärna på Instagram för de senaste uppdateringarna!
          </p>
        </div>

        {/* Höger kolumn – Instagram grid */}
        <div style={{ flex: 1, minWidth: "300px" }}>
          {/* SnapWidget eller LightWidget iframe */}
          <iframe
            src="https://snapwidget.com/embed/123456" // byt ut mot din egen widget-URL
            title="Instagram Gallery"
            className="instagram-widget"
            allowTransparency="true"
            frameBorder="0"
            scrolling="no"
            style={{
              width: "100%",
              height: "600px",
              border: "none",
              overflow: "hidden",
              borderRadius: "8px"
            }}
          ></iframe>
        </div>
      </div>
    </div>
  );
}

export default Gallery;
